import React, { useEffect, useState } from 'react';
import './InputTable.css';



function InputTable(props) {
  const [dataList, setDataList] = useState([]);

  useEffect(() => {
    if (props.data) {
      setDataList(props.data);
    }
  }, [props.data]);






  const [selectedRows, setSelectedRows] = useState([]);
  
  const handleCheckboxChange = (itemId) => {
    if (selectedRows.includes(itemId)) {
      setSelectedRows(selectedRows.filter((id) => id !== itemId));
    } else {
      setSelectedRows([...selectedRows, itemId]);
    }
  };

  // const handleUpdate = () => {
  //   const selectedRows = getSelectedRows();
  //   // Prompt for update for each selected row individually
  //   selectedRows.forEach(row => {
  //     const updatedEntry = prompt(`Enter updated details for ID ${row.id}:`, `${row.name},${row.phone},${row.email},${row.hobbies}`);
  //     if (updatedEntry) {
  //       const [name, phone, email, hobbies] = updatedEntry.split(',');
  //       row.name = name;
  //       row.phone = phone;
  //       row.email = email;
  //       row.hobbies = hobbies;
  //       row.rowElement.cells[2].textContent = name;
  //       row.rowElement.cells[3].textContent = phone;
  //       row.rowElement.cells[4].textContent = email;
  //       row.rowElement.cells[5].textContent = hobbies;
  //     }
  //   });
  //   // Perform update operation on selectedRows
  //   console.log("Updating rows:", selectedRows);
  // };

  const handleDelete = () => {
    const selectedRows = getSelectedRows();
    // Perform delete operation on selected rows
    selectedRows.forEach(row => {
      row.rowElement.remove();
      const index = entries.findIndex(entry => entry.id === row.id);
      if (index !== -1) {
        entries[index].deleted = true; // Mark the entry as deleted
      }
    });

    // Perform delete operation on selectedRows
    console.log("Deleting rows:", selectedRows);
  };
  function getSelectedRows() {
    const selectedRows = [];
    checkboxes.forEach((checkbox) => {
      if (checkbox.checked) {
        const row = checkbox.closest('tr');
        // Exclude deleted rows from being selected
        if (!row.classList.contains('deleted')) {
          const id = Number(row.cells[1].textContent);
          const selectedRow = entries.find((entry) => entry.id === id);
          if (selectedRow) {
            selectedRows.push({
              id: selectedRow.id,
              name: selectedRow.name,
              phone: selectedRow.phone,
              email: selectedRow.email,
              hobbies: selectedRow.hobbies,
              rowElement: row
            });
          }
        }
      }
    });
    return selectedRows;
  }
  



  return (
    <div className="table-container">
      <h2>Data Table</h2>
      <table id="data-table">
        <thead>
          <tr>
            <th>Select</th>
            <th>ID</th>
            <th>Name</th>
            <th>Phone Number</th>
            <th>Email</th>
            <th>Hobbies</th>
          </tr>
        </thead>
        <tbody>
          {dataList.length > 0 ? (
            dataList.map((item) => (
              <tr key={item.id}>
                <td>
                  <input type="checkbox" />
                </td>
                <td>{item.id}</td>
                <td>{item.name}</td>
                <td>{item.phone}</td>
                <td>{item.email}</td>
                <td>{item.hobby}</td>
              </tr>
            ))
          ) : (
            <tr>
              <td colSpan="6">No data available</td>
            </tr>
          )}
        </tbody>
      </table>
      <div className="button-container">
        <button onClick={handleUpdate} disabled={selectedRows.length === 0}>
          Update
        </button>
        <button onClick={handleDelete} disabled={selectedRows.length === 0}>
          Delete
        </button>
      </div>
    </div>
  );
}

export default InputTable;
